webpackJsonp([0x75b954881a33],{3501:function(t,e){t.exports={data:{markdownRemark:{html:'<p>BBSやチャット等は、1度寂れるとなかなかカキコ量が増えず、終いにはHPのカウンタさえ止まってしまうコトもあります。そこで私は、その切れた輪に橋を架けるため、寂れたBBS、チャット、HP等を集め、このようなサークル発足に踏み切りました。今が復活の時!! みんなでBBSを繁盛させましょう!! 当時のWebページ: <a href="http://web.archive.org/web/20011102034255/http://www.geocities.co.jp/Playtown-Domino/3933/jp/">http://web.archive.org/web/20011102034255/http://www.geocities.co.jp/Playtown-Domino/3933/jp/</a> ※このサービスは2000年7月に終了しています。</p>',frontmatter:{cover:null,date:"1999-11-01T18:00:59+09:00",strDate:"1999/11/1",title:"DECLINEd BBS RING"}}},pathContext:{path:"/ja/blog/1999/11/01-declined/",langKey:"ja"}}}});
